import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div>


      <Router>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
        </ul>

        <hr />


        <Routes>
          <Route path="/" element={Home} />
        </Routes>
      </Router>
    </div>
  )
}

function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}




export default App;
